(246, '2021-04-02', 'alfredoduartepulish@', 'Rey Vencedor, Fiesta, Viene Ya', 'Te levantaste con poder\nLeón de la tribu de Judá\nHombre de guerra, el gran YO SOY\nTus enemigos están bajo tus pies\nCristo, Rey vencedor\nCristo, Rey vencedor\nTu victoria es mi victoria, Cristo, Cristo\nTe levantaste con poder\nLeón de la tribu de Judá\nHombre de guerra, el gran YO SOY\nTus enemigos están bajo tus pies\nCristo, Rey vencedor\nCristo, Rey vencedor\nTu victoria es mi victoria, Cristo, Cristo\nCristo, Rey vencedor\nCristo, Rey vencedor\nTu victoria es mi victoria, Cristo, Cristo\nVencedor, vencedor\nCristo, Rey vencedor\nVencedor, vencedor\nCristo, Rey vencedor\nVencedor, vencedor\nCristo, Rey vencedor\nVencedor, vencedor\nCristo, Rey vencedor\nCristo, Rey vencedor\nCristo, Rey vencedor\nTu victoria es mi victoria, Cristo, Cristo\nCristo, Rey vencedor\nCristo, Rey vencedor\nTu victoria es mi victoria, Cristo, Cristo\nPrepárate, en el cielo hay fiesta\n¡En la tierra también hay fiesta\n\n\n\n\n\n\n\nLo que se canta en el cielo\nCantamos en la tierra\nAl que se adora en el cielo\nAdoramos en la tierra\nLo que se canta en el cielo\nCantamos en la tierra\nAl que se adora en el cielo\nAdoramos en la tierra\nAl Santo, digno\nAl Cordero que vive para siempre\nHacemos fiesta\nHoy hacemos una fiesta\nUnidos hoy danzamos\nCon gozo celebramos\nOh uh oh uh oh\nFiesta\nHoy hacemos una fiesta\nEn la tierra cantamos\nJuntos gritamos\nOh uh oh uh oh\nLo que se canta en el cielo\nCantamos en la tierra\nAl que se adora en el cielo\nAdoramos en la tierra\nAl Santo, digno\nAl Cordero que vive para siempre\nHacemos fiesta\nHoy hacemos una fiesta\nUnidos hoy danzamos\nCon gozo celebramos\nOh uh oh uh oh\nFiesta\nHoy hacemos una fiesta\nEn la tierra cantamos\nJuntos gritamos\nOh uh oh uh oh\nHacemos…\n\n\n\n\n\n\n\nPreparemos el camino, Cristo viene ya \nAnunciemos su venida en todo lugar \nQue se abran hoy las puertas, Él viene ya \nVolveremos a adorarle por la eternidad \nViene ya mi amado, p