(249, '2021-05-31', 'fernando0079@icloud.', 'nuevo', 'An App Store receipt is a binary encrypted file signed with an Apple certificate. In order to read the contents of the encrypted file, you need to pass it through the verifyReceipt endpoint. The endpoint\'s response includes a readable JSON body. Communication with the App Store is structured as JSON dictionaries, as defined in RFC 4627. Binary data is Base64-encoded, as defined in RFC 4648. Validate receipts with the App Store through a secure server. For information on establishing a secure network connection with the App Store, see Preventing Insecure Network Connections.\n\nWarning\n\nDo not call the App Store server verifyReceipt endpoint from your app. You can\'t build a trusted connection between a user’s device and the App Store directly, because you don’t control either end of that connection, which makes it susceptible to a man-in-the-middle attack.\n\nFetch the Receipt Data\n\nTo retrieve the receipt data from the app on the device, use the appStoreReceiptURL method of NSBundle to locate the app’s receipt, and encode the data in Base64. Send this Base64-encoded data to your server.\n\n\n// Get the receipt if it\'s available\nif let appStoreReceiptURL = Bundle.main.appStoreReceiptURL,\n    FileManager.default.fileExists(atPath: appStoreReceiptURL.path) {\n\n\n    do {\n        let receiptData = try Data(contentsOf: appStoreReceiptURL, options: .alwaysMapped)\n        print(receiptData)\n\n\n        let receiptString = receiptData.base64EncodedString(options: [])\n\n\n        // Read receiptData\n    }\n    catch { print(\"Couldn\'t read receipt data with error: \" + error.localizedDescription) }\n}\nSend the Receipt Data to the App Store\n\nOn your server, create a JSON object with the receipt-data, password (if the receipt contains an auto-renewable subscription), and exclude-old-transactions keys detailed in requestBody.\n\nSubmit this JSON object as the payload of an HTTP POST request. Use the test environment URL https://sandbox.itunes.apple.com/verifyReceipt when testing your app in the sandbox and while your application is in review. Use the production URL https://buy.itunes.apple.com/verifyReceipt when your app is live in the App Store. For more information on these endpoints, see verifyReceipt.\n\nImportant\n\nVerify your receipt first with the production URL; then verify with the sandbox URL if you receive a 21007 status code. This approach ensures you do not have to switch between URLs while your application is tested, reviewed by App Review, or live in the App Store.\n\nParse the Response\n\nThe App Store\'s response payload is a JSON object that contains the keys and values detailed in responseBody.\n\nThe in_app array contains the non-consumable, non-renewing subscription, and auto-renewable subscription items previously purchased by the user. Check the values in the response for these in-app purchase types to verify transactions as needed.\n\nFor auto-renewable subscription items, parse the response to get information about the currently active subscription period. When you validate the receipt for a subscription, latest_receipt contains the latest encoded receipt, which is the same as the value for receipt-data in the request, and latest_receipt_info contains all the transactions for the subscription, including the initial purchase and subsequent renewals but not including any restores.\n\nYou can use these values to check whether an auto-renewable subscription has expired. Use these values along with the expiration_intent subscription field to get the reason for expiration.    ', ''),
